  false,\n\t\"url\": null,\n\t\"notes\": \"This data set includes five georeferenced
  versions of color aerial photographs from August 26th, 1989, taken over Monte Vista
  National Wildlife Refuge. Like other historic photos, this image allows for interpretation
  of habitat types on the refuge in 1988. Change over time estimates can be made from
  this image using current imagery for comparison. This image, along with others,
  are being used by refuge staff to assist in understanding and visualizing the historical
  content of the lands within the refuge and how they have changed. The original aerial
  photograph was acquired in digital form from USGS EarthExplorer. Individual frames
  were referenced to the 2009 NAIP color imagery with ArcMap 10.0. The resolution
  of the image is 3 meters. This image should be used for resource-level interpretation
  only.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
